import React from 'react'
import { Link } from 'react-router-dom'
import NavList from './css/navlist.module.css'


class Nav extends React.Component {

    render() {
        //console.log('prod',this.props.products)
        return (
            <div>
                <ul className={NavList.list}>
                <li><Link to='/'>Home</Link></li>
                <li><Link to='/menclothing'>Men's Clothing</Link></li>
                <li><Link to='/womenclothing'>Women's Clothing</Link></li>
                <li><Link to='/electronics'>Electronics</Link></li>
                <li><Link to='/jewelery'>Jewelery</Link></li>
                </ul>
            </div>

        )
    }
}

export default Nav
